import React from "react";

const points = [
  {
    activityPoints: "Can't find your activity points?",
    missingPoints: "Report missing points",
  },
  {
    filterMonths: "All of September 2020",
  },
];

const Renderitems = ({ points }) => {
  return points.map((values) => {
    <ul>
      <li>{values.activityPoints}</li>
    </ul>;
  });
};

const Activitypoints = () => {
  return (
    <>
      <ul>
        <li></li>
        <li></li>
      </ul>
    </>
  );
};

export default Activitypoints;
